import '../Navbar.css'
import 'bootstrap/dist/css/bootstrap.css';
const Navbar = () => {
  return (
   <div className='container-fluid' id='navbar'>
      <div id='wrapper'>
        <div id='left'>
          <div id='item'></div>
        </div>




      </div>

   </div>
  )
}

export default Navbar
